  [],\n\t\"revision_timestamp\": \"2016-10-08T15:56:05.222952\",\n\t\"name\": \"environmental-assessment-river-recreation-management-fort-niobrara-national-wildlife-refug\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This environmental assessment document
  is prepared to evaluate the alternatives for managing river recreation on Fort Niobrara
  National Wildlife Refuge. The number of people canoeing and tubing down the Niobrara
  River within Fort Niobrara National Wildlife Refuge has steadily increased over
  a period of years. Increased use has raised concerns about disturbance to wildlife,
  Impact on vegetation, and the quality of visitor experience on the Refuge. This
  environmental assessment analyzes the impact associated with a range of river recreation
  management alternatives and will satisfy National Environmental Policy Act requirements
  concerning river recreation on Fort Niobrara National Wildlife Refuge. The Refuge
  has developed and evaluated four management alternatives, and has selected Alternative
  D - Protect Resources with Emphasis on Wildlife/Fisheries/Vegetation as the alternative
  which best achieves the purposes of the Refuge. The environmental consequences of
  the various alternatives have been reviewed and evaluated.\",\n\t\"license_title\":
